INSERT INTO `product` VALUES (1,2,1,'DeWalt 18V 1/2 In. XRP Hammerdrill Kit','<p>DeWalt 18V 1/2 In. XRP Hammerdrill Kit:<br /><br />ULTIMATE POWER AND INNOVATIVE SOLUTIONS. Quality tools and accessories that professionals depend on. Built tough to handle your most challenging tasks. Solid performance that makes short work of all your projects. Innovative products since 1924. DeWalt 18V Lithium-Ion Hammerdrill Combo Kit. DeWalt 18V 1/2 In. XRP Hammerdrill Kit.<br /><br /></p>\r\n<ul>\r\n<li>XRP extended run-time batteries provide long run-time and battery life</li>\r\n<li>Patented 3-speed all-metal transmission matches the tool to task for fastest application speed and improved runtime</li>\r\n<li>Heavy-duty 1/2 in. self-tightening chuck tightens throughout operation providing superior bit gripping strength</li>\r\n<li>LED worklight provides increased visibility in confined spaces</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>High power, high efficiency motor delivers 450 unit watts out of max power for superior performance in all drilling and fastening applications</li>\r\n<li>Includes: 1 hour charger, (2) 18V XRP batteries, 360 degree side handle and Kit Box</li>\r\n</ul>\r\n<p>Specifications: <br />Cordless/Corded&nbsp;&nbsp;&nbsp; Cordless<br />Assembled Depth (In Inches)&nbsp;&nbsp;&nbsp; 14.13 In.<br />Assembled Height (In Inches)&nbsp;&nbsp;&nbsp; 5.25<br />Assembled Weight (In LBS)&nbsp;&nbsp;&nbsp; 14.4 Lbs.<br />Assembled Width (In Inches)&nbsp;&nbsp;&nbsp; 15.75<br />Country of Origin&nbsp;&nbsp;&nbsp; Mexico<br />CSA Certified&nbsp;&nbsp;&nbsp; Yes<br />Item Depth&nbsp;&nbsp;&nbsp; 14.13 In.<br />Item Height&nbsp;&nbsp;&nbsp; 5.25 In.<br />Item Weight&nbsp;&nbsp;&nbsp; 14.4 Lbs.<br />Item Width&nbsp;&nbsp;&nbsp; 15.75 In.</p>',NULL,NULL,NULL,'DeWalt 18V 1/2 In. XRP Hammerdrill',NULL,'DCD950KX',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,1,1,'2014-05-27 12:47:49','2014-06-20 12:06:25',3,NULL,NULL);
