INSERT INTO `project` VALUES (1,1,27,1,1,'Salle D’eau Et Buanderie','<p>Veuillez trouver ci-joint les informations relatives &agrave; votre projet de r&eacute;novation</p>','<p><strong>NOTE G&Eacute;N&Eacute;RALE CONCERNANT LES MAT&Eacute;RIAUX FOURNIS PAR LES CLIENTS</strong> &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; <br />Seront aux frais des clients, tout le temps pass&eacute; par l&rsquo;entrepreneur (diagnostique, transport, r&eacute;paration&hellip;), dans les cas o&ugrave; les mat&eacute;riaux fournis serait en quantit&eacute; insuffisante ou d&eacute;fectueux. S&rsquo;applique sur les mat&eacute;riaux neufs ou usag&eacute;s. 65$/hre/homme. &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; <br />&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; <br /><strong>TRAVAIL SUPPL&Eacute;MENTAIRE&nbsp;</strong>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; <br />Le prix et la dur&eacute;e des travaux peuvent varier selon les changements faits par le/la client(e) ou suite &agrave; un constat qui ne pouvait &ecirc;tre fait visuellement lors de l&rsquo;estimation. Dans un tel cas, les changements seront &eacute;crits sur une feuille d&rsquo;ajustement. Ces changements seront payables sur l&rsquo;approbation de l&rsquo;ajustement avant r&eacute;alisation.&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; <br />&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; <br /><strong>D&Eacute;LAIS SUPPL&Eacute;MENTAIRE&nbsp;</strong>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; <br />Le travail suppl&eacute;mentaire entra&icirc;nera des d&eacute;lais suppl&eacute;mentaires. Il n\'est pas impossible d\'avoir une interruption du chantier si un sous-traitant ou fournisseur impliqu&eacute; dans la suite du projet ne peut se conformer au nouvel horaire affect&eacute; par le travail suppl&eacute;mentaire. L\'entrepreneur s\'engage &agrave; tout mettre en &oelig;uvre pour limiter au minimum ces interruptions potentielles.</p>',0,0,'2014-02-27 00:00:00',1,2,NULL,'2014-03-04 15:09:57','2014-03-04 15:09:57',0.2,'a:5:{i:0;i:1;i:1;i:2;i:2;i:3;i:3;i:4;i:4;i:5;}',1,1,61,'2014-05-09 15:25:12','06:00:00','18:00:00',0,NULL,NULL,NULL),(2,1,27,1,2,'Rénovation de la cuisine Patricia Lemaire','<p>Couverture compl&egrave;te par la CSST</p>\r\n<p>Assurance responsabilit&eacute; de 2 000 000$</p>','<b>AUTRES NON-INCLUS OU EN SUPPLÉMENT</b>\r\n<br><br>\r\n\r\n<ul>\r\n<li>Peinture de finition. - Après les travaux.</li>\r\n<li>Mouluration. À voir sur place en fonction des possibilités autour de l’escalier et des matériaux récupérables. Prévoir entre 500$ et 2000$. Bull nose, garde-corps, plinthe, boiserie, seuil de transitio</li>\r\n<li>Ébénisterie (frais de gestion 10% - profit - 0%). - Groupe SP coordonne tout le travail - cuisiniste de Cuisine Action - Stéphanie Sirois - 450-645-0118</li>\r\n<li>Porte et fenêtre. Contact PF Métropolitain - pour toute question - Rémi Bernard - 514-806-5835</li>\r\n</ul>\r\n \r\n<b>NOTE GÉNÉRALE CONCERNANT LES MATÉRIAUX FOURNIS PAR LES CLIENTS</b><br>\r\nSeront aux frais des clients, tout le temps passé par l’entrepreneur (diagnostique, transport, réparation…), dans les cas où les matériaux fournis seraient en quantité insuffisante ou défectueux. S’applique sur les matériaux neufs ou usagés. 65$/hre/homme. <br><br>\r\n\r\n<b>TRAVAIL SUPPLÉMENTAIRE</b><br>\r\nLe prix et la durée des travaux peuvent varier selon les changements faits par le/la client(e) ou suite à un constat qui ne pouvait être fait visuellement lors de l’estimation. Dans un tel cas, les changements seront écrits sur une feuille d’ajustement. Ces changements seront payables sur l’approbation de l’ajustement avant réalisation.',0,0,'2014-03-31 00:00:00',1,1,NULL,'2014-03-25 08:39:56','2014-03-25 08:39:56',0.1,'a:5:{i:0;i:1;i:1;i:2;i:2;i:3;i:3;i:4;i:4;i:5;}',5,6,1,'2014-04-01 16:18:21','08:00:00','20:00:00',0.07333626089013,NULL,NULL,NULL),(3,7,27,1,9,'Rénovation générale et Isolation de murs','<p>Groupe SP Reno-Urbaine est fi&egrave;re de pouvoir soumissionner sur votre projet.</p>','<p>TRAVAIL SUPPL&Eacute;MENTAIRE :<br /><br />Le prix et la dur&eacute;e des travaux peuvent varier selon les changements faits par le/la client(e) ou suite &agrave; un constat qui ne pouvait &ecirc;tre fait visuellement lors de l&rsquo;estimation. Dans un tel cas, les changements seront &eacute;crits sur une feuille d&rsquo;ajustement. Ces changements seront payables sur l&rsquo;approbation de l&rsquo;ajustement avant r&eacute;alisation.<br /><br />D&Eacute;LAIS SUPPL&Eacute;MENTAIRE<br /><br />Le travail suppl&eacute;mentaire entra&icirc;nera des d&eacute;lais suppl&eacute;mentaires. Il n\'est pas impossible d\'avoir une interruption du chantier si un sous-traitant ou fournisseur impliqu&eacute; dans la suite du projet ne peut se conformer au nouvel horaire affect&eacute; par le travail suppl&eacute;mentaire. L\'entrepreneur s\'engage &agrave; tout mettre en oeuvre pour limiter au minimum ces interruptions potentielles.<br /><br />NOTE G&Eacute;N&Eacute;RALE CONCERNANT LES MAT&Eacute;RIAUX FOURNIS PAR LES CLIENTS <br /><br />Seront aux frais des clients, tout le temps pass&eacute; par l&rsquo;entrepreneur (diagnostique, transport, r&eacute;paration&hellip;), dans les cas o&ugrave; les mat&eacute;riaux fournis serait en quantit&eacute; insuffisante ou d&eacute;fectueux. Ceci s&rsquo;applique sur les mat&eacute;riaux neufs ou usag&eacute;s. 65$/hre/homme.</p>',0,0,'2014-04-07 00:00:00',1,1,NULL,'2014-03-27 12:55:58','2014-03-27 12:55:58',0.05,'a:5:{i:0;i:1;i:1;i:2;i:2;i:3;i:3;i:4;i:4;i:5;}',19,6,51,'2014-05-09 14:57:22','06:00:00','20:00:00',0,NULL,NULL,NULL),(4,1,27,1,10,'Salle de bain Philippe Bouchard','<p style=\"margin: 0px 0px 10px; color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px;\">Couverture compl&egrave;te par la CSST</p>\r\n<p style=\"margin: 0px 0px 10px; color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-s