span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"margin: 0px 0px 10px; font-size: 14px; font-family: \'Helvetica Neue\'; color: #323333;\"><span style=\"letter-spacing: 0.0px;\">Le travail suppl&eacute;mentaire entra&icirc;nera des d.lais suppl&eacute;mentaires. &nbsp;Il n\'est pas impossible d\'avoir une interruption du chantier si un sous-traitant ou une fournisseur impliqu&eacute; dans la suite du projet ne peut se conformer au nouvel horaire affect&eacute; par le travail suppl&eacute;mentaire. &nbsp;L\'entrepreneur s\'engage &agrave; tout mettre en oeuvre pour limiter au minimum ces interruptions potentielles.</span></p>\r\n<p><span style=\"letter-spacing: 0.0px;\">&nbsp;</span></p>',1,0,'2014-08-04 00:00:00',1,1,NULL,'2014-05-02 09:11:38','2014-05-02 09:11:38',0.1,'a:5:{i:0;i:1;i:1;i:2;i:2;i:3;i:3;i:4;i:4;i:5;}',17,12,NULL,NULL,'07:00:00','18:00:00',0,NULL,NULL,NULL),(13,7,27,1,31,'Marc Duchesne: Salle de bain principale','<p style=\"margin: 0px 0px 10px; font-size: 14px; font-family: \'Helvetica Neue\'; color: #323333;\"><span style=\"letter-spacing: 0.0px;\">Couverture compl&egrave;te par la CSST</span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"margin: 0px 0px 10px; font-size: 14px; font-family: \'Helvetica Neue\'; color: #323333;\"><span style=\"letter-spacing: 0.0px;\">Assurance responsabilit&eacute; de 2 000 000$</span></p>\r\n<p><span style=\"letter-spacing: 0.0px;\">&nbsp;</span></p>\r\n<p><span style=\"letter-spacing: 0.0px;\"><span style=\"text-decoration: underline;\"><strong>R&Eacute;NOVATION D\'UNE SALLE DE BAIN</strong></span><br /></span></p>','<p style=\"margin: 0px; font-size: 14px; font-family: \'Helvetica Neue\'; color: #323333;\"><span style=\"letter-spacing: 0.0px;\">AUTRES NON-INCLUS OU EN SUPPL&Eacute;MENT</span></p>\r\n<p style=\"margin: 0px; font-size: 14px; font-family: \'Helvetica Neue\'; color: #323333;\"><span style=\"letter-spacing: 0.0px;\">&nbsp;</span></p>\r\n<p style=\"margin: 0px; font-size: 14px; font-family: \'Helvetica Neue\'; color: #3233