INSERT INTO `project_opportunity` VALUES (1,1,105,1,27,1,'Salle D’eau Et Buanderie','<p>C\'est une salle de bain qui est &agrave; produire.</p>','2014-02-27 00:00:00',0,10000,'2014-03-04 14:38:18','2014-03-04 14:38:18',0),(2,1,255,2,27,1,'Réfection d\'un sous-sol','<p>Demande une soumission pour faire la r&eacute;fection de son sous-sol</p>',NULL,NULL,NULL,'2014-03-05 10:20:07','2014-03-05 10:20:07',0),(3,1,257,1,27,1,'Rénovation générale','<p>Peinture au rez-de-chauss&eacute;, porte de chambre &agrave; changer, bout de comptoire a poser sur lave-vaisselle, garde robe manque porte, tablette et p&ocirc;le. Peut-&ecirc;tre r&eacute;nover une salle de bain. Travaux &eacute;lectrique a un tableau de 125 amps et aimerais 200 amps.&nbsp;</p>\r\n<p>Carthier Ahuntsic</p>',NULL,NULL,NULL,'2014-03-13 13:08:26','2014-03-13 13:08:26',0),(4,1,258,1,27,1,'Sous-sol a creuser et faire','<p>Elle veut faire faire son sous-sol mais elle a aussi une cuisine et salle de bain a faire ensuite.</p>\r\n<p>50 000 a 100 000 (100 0000 est trop pour elle)</p>\r\n<p>&nbsp;</p>\r\n<p>le moment ideal pour avoir les 2 decideurs est le mercredi, jeudi ou vendredi soir.&nbsp; Si non, elle est disponible le lundi&nbsp; ou mardi dans le jour</p>\r\n<p>&nbsp;</p>\r\n<p>La cleinte est r&eacute;f&eacute;r&eacute;e par &Eacute;milie Leduc (ancienne cliente)</p>','2014-08-03 00:00:00',0,50000,'2014-03-18 09:57:27','2014-03-18 09:57:27',0),(5,1,162,1,27,1,'Rénovation de la cuisine','<p>r&eacute;novation de la cuisine de Patricia Lemaire, ancienne cliente</p>','2014-04-30 00:00:00',0,25000,'2014-03-25 08:28:40','2014-03-25 08:28:40',0),(6,1,260,1,27,1,'Sous-sol à finir et plus','<p>Changer une poutre centrale</p>\r\n<p>Changer les portes arri&egrave;res</p>\r\n<p>Agrandissement de fen&ecirc;tre</p>\r\n<p>Finir le sous-sol qui n\'a que 7 pieds, creuser et couler dalle de b&eacute;ton</p>',NULL,NULL,NULL,'2014-03-25 17:13:13','2014-03-25 17:13:13',0),(7,1,261,1,27,1,'Salle de Bain','<p>Refaire une salle de bain fin mai d&eacute;but juin si possible.&nbsp;</p>\r\n<p>La client a d&eacute;j&agrave; les plans du designer</p>',NULL,NULL,NULL,'2014-03-26 10:40:10','2014-03-26 10:40:10',0),(8,1,264,1,27,1,'Nivelage de plancher','<p>Le plancher c\'est affess&eacute; et il faudrait reniveller.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Client plut&ocirc;t d&eacute;sagr&eacute;able</p>\r\n<p>Il dit avoir d&eacute;j&agrave; appel&eacute; mais pas avoir fais affaire avec nous car on est trois fois plus cher qu\'autre part.&nbsp;</p>\r\n<p>J\'ai pas son courriel dans les coordonn&eacute;es car il ma dit que l\'on &eacute;tait pas rendu l&agrave; et ne voulait pas le donner. M&ecirc;me son adresse il a chial&eacute; que nous devions l\'avoir puisqu\'il a d&eacute;j&agrave; appel&eacute;. De regarder devant moi dans mes contrats.&nbsp;</p>\r\n<p>&nbsp;</p>',NULL,NULL,NULL,'2014-03-27 10:47:35','2014-03-27 10:47:35',0),(9,7,265,3,27,1,'Rénovation général','<p>Enl&egrave;vement de mur porteur, cr&eacute;ation de nouvelles cloisons et isolation de mur mitohyen et mur ext&eacute;rieur.</p>','2014-04-04 00:00:00',4,40000,'2014-03-27 12:31:58','2014-03-27 12:31:58',0),(10,1,169,5,27,1,'Salle de bain Philippe Bouchard','<p>ancien client</p>','2014-04-22 00:00:00',0,15000,'2014-03-29 07:46:16','2014-03-29 07:46:16',0),(11,7,267,2,27,1,'Rénovation générale Guido Colantoni','<p>2 salle de bain</p>\r\n<p>cuisine</p>\r\n<p>mur porteur</p>\r\n<p>sous-sol</p>\r\n<p>&nbsp;</p>\r\n<p>Il est au d&eacute;but du processus. &nbsp;Pas encore de desiner.</p>','2014-04-30 00:00:00',0,100000,'2014-03-31 10:54:14','2014-03-31 10:54:14',0),(12,1,302,1,27,1,'Rez-de-chaussée après sinistre','<p>Rez-de -chauss&eacute;e &agrave; refaire apr&egrave;s sinistre a Cote St-Luc</p>',NULL,0,NULL,'2014-04-02 11:09:44','2014-04-02 11:09:44',0),(13,1,332,1,27,1,'Transformation de 2 condos en un seul Hung Nguyen','<p>Veut prendre 2 condos et le transformer en un seul</p>\r\n<p>Ville Mon-Royal (oups! &nbsp;j\'ai oubli&eacute; de prendre son adresse!)</p>\r\n<p>Il a appel&eacute; Avantages plus aussi</p>\r\n<p>Il a contact&eacute; aussi une firme d\'architecte, mais je l\'emlignait plus vers designer. &nbsp;Pas fix&eacute;, a suivre.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','2014-05-01 00:00:00',0,100000,'2014-04-08 11:45:52','2014-04-08 11:45:52',0),(14,8,337,4,27,1,'Mur porteur Sophie Callies','<p>Mur porteur &agrave; retirer entre la cuisine et la salle &agrave; d&icirc;ner</p>','2014-04-18 00:00:00',0,4000,'2014-04-12 10:19:59','2014-04-12 10:19:59',0),(15,8,81,4,27,1,'Cuisine Gilles Morais','<p>R&eacute;novation de cuisine</p>','2014-04-18 00:00:00',0,80000,'2014-04-12 11:42:29','2014-04-12 11:42:29',0),(16,8,206,4,27,1,'Rénovations diverses','<p>Divers travaux d\'am&eacute;lioration et de r&eacute;paration</p>','2014-04-18 00:00:00',0,10000,'2014-04-12 12:57:21','2014-04-12 12:57:21',0),(17,1,193,1,27,1,'un étage complet a refaire','<p>Ancien client qui aimerait faire refaire un &eacute;tage complet, salle de bain, cuisine et autre.&nbsp;</p>',NULL,NULL,NULL,'2014-04-16 11:03:23','2014-04-16 11:03:23',0),(18,1,339,1,27,1,'Salle de bain','<p>R&eacute;novation d\'une petite salle de bain</p>',NULL,NULL,10000,'2014-04-16 13:32:55','2014-04-16 13:32:55',0),(19,1,340,1,27,1,'Réno sur le plateau','<p>La maison fait un L et aimerait cr&eacute;er une pi&egrave;ce au premier et une au deuxi&egrave;me.&nbsp;</p>',NULL,NULL,120000,'2014-04-16 14:07:17','2014-04-16 14:07:17',0),(20,1,349,1,27,1,'Cuisine, salle de bain et buanderie Denis Deblois','<p>client tr&egrave;s gentil</p>','2014-07-18 00:00:00',0,100000,'2014-04-22 15:45:23','2014-04-22 15:45:23',0),(21,1,353,1,27,1,'Projet non défini encore','<p>Message sur la bo&icirc;te a Eric, je ne sais pas cet quoi le projet et dans le contact j\'ai seulement le nom et t&eacute;l&eacute;phone de la cliente.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>',NULL,NULL,NULL,'2014-04-28 10:26:19','2014-04-28 10:26:19',0),(22,1,354,1,27,1,'Projet non définis encore','<p>Message sur la bo&icirc;te a Eric, je n\'ai pas d\'info sauf le nom du client et le num&eacute;ro de t&eacute;l&eacute;phone.&nbsp;</p>\r\n<p>Il dit avoir fait une demande pour une soumission il y a une dixaine de jours.&nbsp;</p>',NULL,NULL,NULL,'2014-04-28 10:28:31','2014-04-28 10:28:31',0),(23,1,355,1,27,1,'Changer une cuisine d\'étage','<p>La cuisine est pr&eacute;sentement au semi sous-sol et ils aimeraient remonter la cuisine &agrave; l\'&eacute;tage</p>\r\n<p>Le client a d&eacute;j&agrave; les armoires en commande</p>',NULL,NULL,NULL,'2014-04-28 10:30:40','2014-04-28 10:30:40',0),(24,1,356,1,27,1,'Giovanni Landy','<p>Sous-sol deja demoli</p>\r\n<p>&nbsp;</p>\r\n<p>Il veut reconstruire son sous-sol</p>\r\n<p>&nbsp;</p>\r\n<p>Ahunstic.</p>\r\n<p>&nbsp;</p>\r\n<p>Oups! &nbsp;J\'ai oubli&eacute; de prendre l\'adresse...!</p>','2014-04-28 00:00:00',NULL,NULL,'2014-04-28 10:48:44','2014-04-28 10:48:44',0),(25,1,108,1,27,1,'Josée Ménard:  Conduit de sécheuse','<p>Changer son conduit de s&eacute;cheuse</p>','2014-05-09 00:00:00',0,980,'2014-04-28 10:56:38','2014-04-28 10:56:38',0),(26,1,26,1,27,1,'Réno suite a infiltration d\'eau','<p>Il y a eu infiltration d\'eau alors il y aurrait l\'isolation a faire, murs, pl&acirc;tre, peinture, plancher et peut-&ecirc;tre autre chose.&nbsp;</p>',NULL,NULL,NULL,'2014-04-29 11:55:27','2014-04-29 11:55:27',0),(27,1,125,4,27,1,'Peter Assimakopoulos - Exterior staircase','<p>Agrandissement pour sortie ext&eacute;rieure du sous-sol</p>','2014-05-30 00:00:00',0,35000,'2014-04-30 08:07:10','2014-04-30 08:07:10',0),(28,1,358,1,27,1,'Camellia Boulia:sous-sol','<p>Sous-sol a refaire</p>\r\n<p>salle de bain</p>\r\n<p>escalier</p>\r\n<p>renovation d\'un extension</p>\r\n<p>Elle veut faire par phases</p>\r\n<p>Elle a eu un degat d\'eau et doit tout refaire. &nbsp;Elle choisi l\'entrepreneur, mais elle demande a ses assurnces de payer</p>',NULL,0,NULL,'2014-04-30 08:37:00','2014-04-30 08:37:00',0),(29,1,360,1,27,1,'Vieille maison avec beaucoup de travaux a faire','<p>Anicenne maison, le propri&eacute;taire ne sait pas trop ce qu\'il y aurait a faire, il dit isolation, planchers et beaucoup autre chose. Ne sait pas combien il veut mettre environ et ne connait pas du tout la fa&ccedil;on de s\'y prendre.</p>',NULL,NULL,NULL,'2014-04-30 12:42:57','2014-04-30 12:42:57',0),(30,7,354,1,27,1,'Christophe Kolan: Rénovation de cuisine et Solarium','<p>R&eacute;novation de cuisine partielle et de solarium</p>','2014-08-29 00:00:00',4,60000,'2014-05-02 09:06:30','2014-05-02 09:06:30',0),(31,7,339,1,27,1,'Marc Duchesne: Salle de bain','<p>R&eacute;novation d\'une salle de bain de 7\' * 5\'</p>','2014-05-23 00:00:00',4,15000,'2014-05-02 11:25:56','2014-05-02 11:25:56',0),(32,1,357,1,27,1,'Salle de bain - TEST-2014-M07-17 ( Fidel )','<p>blablabla this is a test</p>','2014-07-31 00:00:00',5,10000,'2014-07-17 17:35:54','2014-07-17 17:35:54',0);
