INSERT INTO `status` VALUES (2,2,'canceled','Canceled','\"Cancel\" status :\r\n\r\nCan only be canceled a \"Purchase Order\" that is not yet being received in the Reception Module.','fa042c','-1',0),(4,2,'new','New','\"New\" status :\r\n\r\nThese \"Purchase Orders\" can be edited as long as they are not been received in the Reception Module.\r\n\r\nThe difference between a \"draft\" order that can be changed and edited any time is that when we are editing a \"Draft\" it has no effect in the stocks levels. \r\nWhereas a \"New\" \"Purchase Order\" will affect levels of the \"Projected Stocks\".','0088CC','1',1),(5,2,'receiving','Receiving','\"Receiving\" Status: \r\n\r\nMeans the order started to be received from your supplier. So you can\'t \"edit\" this \"Purchase Order\" because the reception of your products is now initiated in the Reception Module.\r\n\r\nYou can\'t also change the status of your \"Purchase Order\" to \"Cancel\" as long as you are \"Receiving\". (You started your reception in another module)\r\n\r\nTo be able to \"Cancel\" a partially received order you first will need to go to the Reception Module and there revert the reception by returning the goods as if the where not yet received.','be41b1','2',2),(6,2,'finalized','Finalized','\"Finalized\" status : \r\nIt means all products ordered in this transaction were 100% received.\r\n\r\nIt also means that you paid everything you were supposed to pay to your supplier for this \"Purchase Order\" invoice.','29b304','3',3),(10,4,'to_produce','To Produce','To Produce (To start soon, some scheduling can be necessary)','ad8601','0',0),(11,4,'started','Started','Started','e106cf','1',1),(12,4,'completed','Completed (pending)','All tasks done. But some money needs to be collected from client','058be0','2',2),(13,4,'finalized','Finalized','All paid, all done','75bd03','3',3),(15,5,'Paid','Paid','Your client paid all the money in relation to this invoice','058be0','2',0),(16,5,'Partially paid','Partially paid','Your client has paid a part of this invoice.','75bd03','1',1),(17,5,'Unpaid','Unpaid','Here the invoice is only due and your client has \"x\" amount of time to pay this invoice','e106cf','0',2),(18,5,'Overdue','Overdue','you created the invoice and set a certain time for your client to pay. After that time is over the invoice status will change to \"Overdue\"','fc0231','-1',3),(19,2,'finalized','Finalized',NULL,NULL,'4',4),(20,6,'fixed','Fixed',NULL,NULL,'1',0),(21,6,'quantity','Quantity',NULL,NULL,'0',1),(22,6,'surface','Surface',NULL,NULL,'2',2),(23,6,'time','Time',NULL,NULL,'3',3),(24,7,'free','Free',NULL,NULL,'0',0),(25,7,'payable','Payable',NULL,NULL,'1',1),(26,7,'adjustment','Adjustment',NULL,NULL,'2',2),(28,8,'project','Project',NULL,NULL,'0',0),(29,8,'estimate','Estimate',NULL,NULL,'1',1),(30,9,'new','New',NULL,NULL,'0',0),(31,9,'inprogress','Inprogress',NULL,NULL,'1',1),(32,9,'resolved','Resolved',NULL,NULL,'2',2),(33,9,'feedback','Feedback',NULL,NULL,'3',3),(34,9,'closed','Closed','When the task is said to be status \"Closed\" it means you executed the tasl at 100% and you accepted the quality of this task. So now the \"closed\" task can be invoiced','058be0','4',4),(35,9,'cancelled','Cancelled','The task is not longer to do... \r\nAll \"Cancelled\" tasks can be refund to the client if they were included in \"real invoice\".\r\nIf the invoice is \"Cancelled\" then you won\'t see the task in \"draft invoices\"','fc0231','5',5),(36,4,'canceled','Cancelled',NULL,'fc0231','4',4),(37,10,'finish_to_start','Finish_to_start',NULL,NULL,'0',0),(38,10,'finish_to_finish','Finish_to_finish',NULL,NULL,'1',1),(39,10,'start_to_start','Start_to_start',NULL,NULL,'2',2),(40,11,'new','New',NULL,NULL,'0',0),(41,11,'in progress','In progress',NULL,NULL,'1',1),(42,11,'lost','Lost',NULL,NULL,'2',2),(43,5,'Cancelled','Cancelled',NULL,NULL,'-2',4),(44,11,'won','Won',NULL,NULL,'3',3);
