INSERT INTO `task_dependency` VALUES (1,'Finish-to-Start','Finish-to-Start :\r\n\"A\" FS \"B\" = \"B\" can\'t start before  \"A\" is finished.\r\nIn other words, Activity \"A\" must be completed before Activity \"B\" can begin.\r\n\r\nLearn more here : \r\nhttp://en.wikipedia.org/wiki/Dependency_%28project_management%29','a88f4c',NULL),(2,'Finish-to-Finish','Finish-to-Finish :\r\n\"A\" FF \"B\" = \"B\" can\'t finish before \"A\" is finished.\r\nIn other words, Activity \"A\" must be complete before Activity \"B\" can finish. So both Activities finish at the same time.\r\n\r\nLearn more here : \r\nhttp://en.wikipedia.org/wiki/Dependency_%28project_management%29','fb10dd',NULL),(3,'Start to Start','Start to Start (SS):\r\n\"A\" SS \"B\" = \"B\" can\'t start before \"A\" starts.\r\nIn other words, Activity \"B\" can start after Activity \"A\" has started.\r\n\r\nLearn more here : \r\nhttp://en.wikipedia.org/wiki/Dependency_%28project_management%29','5d6c52',NULL),(4,'Start-to-Finish','Start to Finish (SF) :\r\n\"A\" SF \"B\" = \"B\" can\'t finish before \"A\" starts\r\nWhen the start date of Task 1 determines the finish date of Task 2, the tasks have a Start-to-Finish (SF) dependency.\r\n\r\nLearn more here : \r\nhttp://en.wikipedia.org/wiki/Dependency_%28project_management%29','2384fb',NULL);
/*!40000 ALTER TABLE `task_dependency` ENABLE KEYS */;
UNLOCK TABLES;

